import React from "react";
import ReactDOM from "react-dom";
import { BroweserRouter as Router } from "react-router-dom";
import "./index.css";
import App from "./App";

ReactDOM.render <
  BroweserRouter(
    <Router>
      <App />
    </Router>,
    document.getElementById("root")
  );
